import React, { useState } from 'react'
import '../sass/form/form.css'

export default function Form() {

    const [inputText,outputText] = useState()

    const initText=(event)=>{
        outputText(event.target.value)
    }
    return (
        <div className='form'>
            <h1>hello {inputText}</h1>
            <br />
            <input type="text" onChange={initText} />
        </div>
    )
}
